import React from "react";
import "./PhotoGrid.css";

const PhotoGrid = ({ photos }) => {
    return (
        <div className="photo-grid">
            {photos.map((photo, index) => (
                <img key={index} src={photo} alt={`Sky ${index}`} className="photo" />
            ))}
        </div>
    );
};

export default PhotoGrid;
